import React from "react";
import "../Styles/Body.css";
import ux1 from "../Images/CcfMockup1.png";
import ux2 from "../Images/CcfMockup2.png";

const Body = () => {
  return (
    <div className="projects-container">
      <div className="project-item">
        <img src={ux1} alt="Project 1" className="project-image" />
        <img src={ux2} alt="Project 2" className="project-image" />
      </div>

      <div className="text">
        <h3>Odd Sox</h3>
        <p>A website redesign for a sock brand that specializes in selling unique designs featuring iconic shows, artists, and pop culture icons.</p>
      </div>
    </div>
  );
};

export default Body;
